import React, { useState, useEffect } from "react";
import Item from "../Item";

export const ItemList = ({ dataToShow }) => {
  return (
    <>
      {dataToShow.length == 0 ? (
        <h1>Cargando...</h1>
      ) : (
        <ul>
          {dataToShow.map((reloj) => (
            <Item
              key={reloj.id}
              title={reloj.title}
              price={reloj.price}
              pictureUrl={reloj.pictureUrl}
              alt={reloj.alt}
            />
          ))}
        </ul>
      )}
    </>
  );
};

export default ItemList;
